import React from "react";
import '../styles/Intro.css';

function Intro() {
  return (
    <div className="intro">
      <div className="intro-body">
        <div className="intro-body-title">Welcome</div>
        <div className="intro-body-buttons">
          <button className="intro-link shop-mens">Shop Mens</button>
          <button className="intro-link shop-womens">Shop Womens</button>
        </div>
      </div>
    </div>
  )
}

export default Intro;
